== 简介 ==
由日本GUST（ガスト）及Banpresto共同开发的PS2和PS3游戏系列作《'''[[魔塔大陆系列]]'''》第三作'''《[[魔塔大陆系列|魔塔大陆3～世界终焉的引线是少女弹奏之诗～]]》'''的插入曲，收录于2010年1月27日发售的插入曲集《'''咲夜琉命〜SAKIYA=RUMEI ArTonelicoIII hymmnos concert side.苍〜'''》。

该曲用Hymmnos诗语（俗称AT塔语）所唱。这种语言是由“土屋晓（Akira Tsuchiya）”创作的一种自制语言（人造语），专用于游戏Ar tonelico（魔塔大陆）全系列中。在游戏中，该语言主要是作为诗魔法语言使用。这个语言的有趣之处在于加了许多强调感情的词语，可以根据语言中的“{{注解|想音|由于Hymmnos语主要用于表达咏唱者的情感，所以绝大多数的句子都开始于三个单词（称之为“想音”）}}”来翻译出歌词的意思，同时还可以读取歌者在吟诵每一句歌词时的瞬间心情，几乎可以做到每一句歌词都能表现出前一句和后一句之间出现的情绪的波动和心情的微妙变化。

